import React, {useState} from 'react';
import {Divider, Heading, Table, TableCaption, Tbody, Td, Th, Thead, Tr} from "@chakra-ui/react";

const AssignedQuizPage = () => {

    const [isLoading,setLoading] = useState(true);

    return (
        <>

            <Heading textAlign={'center'}>Assigned quizess</Heading>
            <Divider my={5}/>

            <Table size={'lg'} variant={'striped'} colorScheme={'teal'}>
                <TableCaption >Assigned Quizzes</TableCaption>
                <Thead>
                    <Tr>
                        <Th>No</Th>
                        <Th>Quiz Name</Th>
                        <Th>Date</Th>
                        <Th>Action</Th>
                    </Tr>
                </Thead>

                <Tbody>
                    {
                        [1, 2, 3, 4, 5].map((item, i) => (
                            <Tr key={i}>
                                <Td>{i + 1}</Td>
                                <Td>Spring boot</Td>
                                <Td>Date</Td>
                                <Td>Action</Td>
                            </Tr>
                        ))
                    }

                </Tbody>

            </Table>
        </>
    );
};

export default AssignedQuizPage;
